import PosData from "./positionData";
import Vector2 from "../Vector2";
export let positions = new Map();

export function GetPositionData(id) {
  if (positions.has(id)) {
    positions.get(id);
  }
}
export function UpdatePositionData(id, newPosition) {
  if (positions.has(id)) {
    positions.set(id, newPosition);
  }
}
